@import '../../css/element.scss';
.panel{
    @include panel;
    >h4{
        padding-bottom: 30px;
    }
    .content{
        @include flex(row);
        position: relative;
        justify-content: space-around;
        padding-bottom: 60px;
        img{
            width: 32%;
            height: 260px;
            &:nth-child(2){
                padding: 0 3px;
            }
        }
        span{
            position: absolute;
            right: 10px;
            top: -112px;
            font-size: 28px;
            color: #999;
            height: 112px;
            line-height: 95px;
        }
    }
}
